import React from "react";

export default function FormattedTime(props) {
  function getTime() {
    let currentTime = props.date.toLocaleTimeString("en-US", {
      hour: "2-digit",
      minute: "2-digit",
    });
  }

  setInterval(currentTime, 1000);
  return <div className='formattedTime'>{currentTime}</div>;
}
